import web3 from "./web3";
import RegisterPatien from "./build/RegisterPatient.json";

const instance = new web3.eth.Contract(
    RegisterPatien.abi,
    "0x60bB264aC04E134A02893c97782D22aC3f2FEA00"
);

export default instance;
